        ch.pipeline().addLast(new IdleStateHandler(0,4,0,TimeUnit.SECONDS)).addLast(new ProtobufVarint32FrameDecoder()).addLast(new ProtobufDecoder(ClientTransferData.ClientTransferDataProtoc.getDefaultInstance())).addLast(new ProtobufVarint32LengthFieldPrepender()).addLast(new ProtobufEncoder()).addLast(new SecondProtobufCodec()).addLast(new ProtobufTransferHandler());
