@Override public void call(ClientSide robot,String data){
  ServerContains.THREAD_EXCUTER.execute(() -> {
    Room room=ServerContains.getRoom(robot.getRoomId());
    List<Poker> landlordPokers=new ArrayList<>(20);
    landlordPokers.addAll(robot.getPokers());
    landlordPokers.addAll(room.getLandlordPokers());
    List<Poker> leftPokers=new ArrayList<>(17);
    leftPokers.addAll(robot.getPre().getPokers());
    List<Poker> rightPokers=new ArrayList<>(17);
    rightPokers.addAll(robot.getNext().getPokers());
    PokerHelper.sortPoker(landlordPokers);
    PokerHelper.sortPoker(leftPokers);
    PokerHelper.sortPoker(rightPokers);
    TimeHelper.sleep(300);
    Map<String,Object> map=MapHelper.parser(data);
    int expectedScore=RobotDecisionMakers.getLandlordScore(room.getDifficultyCoefficient(),leftPokers,rightPokers,landlordPokers);
    int highestScore=(Integer)map.get("highestScore");
    String result;
    if (expectedScore > highestScore) {
      result=MapHelper.newInstance().put("highestScore",expectedScore).put("currentLandlordId",robot.getId()).json();
    }
 else {
      result=data;
    }
    ServerEventListener.get(ServerEventCode.CODE_GAME_LANDLORD_ELECT).call(robot,result);
  }
);
}

@Override public void call(ClientSide robot,String data){
  ServerContains.THREAD_EXCUTER.execute(() -> {
    Room room=ServerContains.getRoom(robot.getRoomId());
    PokerSell lastPokerSell=null;
    PokerSell pokerSell=null;
    if (room.getLastSellClient() != robot.getId()) {
      lastPokerSell=room.getLastPokerShell();
      pokerSell=RobotDecisionMakers.howToPlayPokers(room.getDifficultyCoefficient(),lastPokerSell,robot);
    }
 else {
      pokerSell=RobotDecisionMakers.howToPlayPokers(room.getDifficultyCoefficient(),null,robot);
    }
    if (pokerSell != null && lastPokerSell != null) {
      SimplePrinter.serverLog("Robot monitoring[room:" + room.getId() + "]");
      SimplePrinter.serverLog("last  sell  -> " + lastPokerSell.toString());
      SimplePrinter.serverLog("robot sell  -> " + pokerSell.toString());
      SimplePrinter.serverLog("robot poker -> " + PokerHelper.textOnlyNoType(robot.getPokers()));
    }
    TimeHelper.sleep(300);
    if (pokerSell == null || pokerSell.getSellType() == SellType.ILLEGAL) {
      ServerEventListener.get(ServerEventCode.CODE_GAME_POKER_PLAY_PASS).call(robot,data);
    }
 else {
      Character[] cs=new Character[pokerSell.getSellPokers().size()];
      for (int index=0; index < cs.length; index++) {
        cs[index]=pokerSell.getSellPokers().get(index).getLevel().getAlias()[0];
      }
      ServerEventListener.get(ServerEventCode.CODE_GAME_POKER_PLAY).call(robot,Noson.reversal(cs));
    }
  }
);
}

@SuppressWarnings("unchecked") static RobotEventListener get(ClientEventCode code){
  RobotEventListener listener=null;
  try {
    if (RobotEventListener.LISTENER_MAP.containsKey(code)) {
      listener=RobotEventListener.LISTENER_MAP.get(code);
    }
 else {
      String eventListener=LISTENER_PREFIX + code.name();
      Class<RobotEventListener> listenerClass=(Class<RobotEventListener>)Class.forName(eventListener);
      try {
        listener=listenerClass.getDeclaredConstructor().newInstance();
      }
 catch (      NoSuchMethodException|InvocationTargetException e) {
        e.printStackTrace();
      }
      RobotEventListener.LISTENER_MAP.put(code,listener);
    }
    return listener;
  }
 catch (  ClassNotFoundException|InstantiationException|IllegalAccessException e) {
    e.printStackTrace();
  }
  return null;
}

@Override public void start(int port) throws InterruptedException {
  EventLoopGroup parentGroup=Epoll.isAvailable() ? new EpollEventLoopGroup() : new NioEventLoopGroup();
  EventLoopGroup childGroup=Epoll.isAvailable() ? new EpollEventLoopGroup() : new NioEventLoopGroup();
  try {
    ServerBootstrap bootstrap=new ServerBootstrap().group(parentGroup,childGroup).channel(Epoll.isAvailable() ? EpollServerSocketChannel.class : NioServerSocketChannel.class).localAddress(new InetSocketAddress(port)).childHandler(new ChannelInitializer<SocketChannel>(){
      @Override protected void initChannel(      SocketChannel ch) throws Exception {
        ch.pipeline().addLast(new IdleStateHandler(60 * 30,0,0,TimeUnit.SECONDS)).addLast(new HttpServerCodec()).addLast(new ChunkedWriteHandler()).addLast(new HttpObjectAggregator(8192)).addLast("ws",new WebSocketServerProtocolHandler("/ratel")).addLast(new WebsocketTransferHandler());
      }
    }
);
    ChannelFuture f=bootstrap.bind().sync();
    SimplePrinter.serverLog("The websocket server was successfully started on port " + port);
    RobotDecisionMakers.init();
    f.channel().closeFuture().sync();
  }
  finally {
    parentGroup.shutdownGracefully();
    childGroup.shutdownGracefully();
  }
}

